import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav>
        <ul>
            <li><Link to="/add"></Link></li>
            <li><Link to="/all"></Link></li>
            <li><Link to="/"></Link></li>
            <li></li>
        </ul>
    </nav>
  )
}

export default Navbar
